class Solution:
    def maxOperations(self, s: str) -> int:
        cs=s[0]
        for x in s[1:]:
            if(x=="1" or cs[-1]=="1"):
                cs+=x
        res=0
        curr=0
        for x in cs:
            if(x=="1"):
                curr+=1
            else:
                res+=curr
        return res
